import React from 'react';
import PropTypes from 'prop-types';

function SleepChart({ patientId, data, viewMode = 'patient', isExpanded = false }) {
  const sleepData = data?.sleepData || [];

  if (!sleepData.length) {
    return (
      <div className="chart-placeholder">
        <p>No sleep data available for {patientId}</p>
      </div>
    );
  }

  return (
    <div className="sleep-chart">
      <div className="chart-content" style={{ height: isExpanded ? 450 : 300 }}>
        <p>Sleep Chart - {sleepData.length} sleep records</p>
        <p>Chart implementation coming soon...</p>
      </div>
    </div>
  );
}

SleepChart.propTypes = {
  patientId: PropTypes.string.isRequired,
  data: PropTypes.object.isRequired,
  viewMode: PropTypes.oneOf(['patient', 'physician']),
  isExpanded: PropTypes.bool
};

export default SleepChart;
